import React, { Component } from 'react'
import { connect } from 'react-redux'
import { Row, Col, Table, Icon } from 'react-materialize'
export class ContactTable extends Component {
    render() {

        const {contacts} = this.props

        return (
            <Row>
            <Col x={12} s={12} l={12} m={12} xl={12}>
                <h5>Contacts</h5>
                <Table x={12} s={12} l={12} m={12} xl={12}>
                    <thead>
                        <tr>
                            <th data-field='id'>Name</th>
                            <th data-field='name'>Phone</th>
                            <th data-field='email'>Email</th>
                            <th data-field='action'>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        {contacts.map(contact => {
                            return (
                                <tr key={contact._id}>
                                    <td>{contact.name}</td>
                                    <td>{contact.phone}</td>
                                    <td>{contact.email}</td>
                                    <td>
                                        <a href="#"><Icon>create</Icon></a>
                                        <a href="#" style={{marginLeft:"20px", color: "red"}}><Icon>clear</Icon></a>
                                    </td>
                                </tr>
                            );
                        })}
                    </tbody>
                </Table>
            </Col>
        </Row>
        )
    }
}

